B.XO=new A.y(4,{en_us:"The Pricing application was born out of the need to reduce the existing delay in collecting information from competitors.\n\nAs the main objective of bringing the agility and ease of the digital world, obtaining data in real time.Thus, being able to compare the competitors' mixes and optimize the response time and know which products have the best opportunity and what their price is in order to have a faster response and accurate follow-ups.",pt_br:"O aplicativo Pricing nasceu da necessidade de reduzir o delay existente na coleta das informa\xe7\xe3o dos concorrentes.\n\nComo principais objetivo de trazer a agilidade e facilidade do mundo digital, obtendo os dados em tempo real. Assim, podendo comparar os mix dos concorrentes e otimizar o tempo de resposta e saber quais s\xe3o os produtos com melhor oportunidade e qual o seu pre\xe7o para poder ter uma resposta mais r\xe1pida e acompanhamentos precisos.",es_ES:"La aplicaci\xf3n de Precios naci\xf3 de la necesidad de reducir la demora existente en la recolecci\xf3n de informaci\xf3n de los competidores.\n\nComo objetivo principal traer la agilidad y facilidad del mundo digital, la obtenci\xf3n de datos en tiempo real.As\xed, poder comparar los mix de la competencia y optimizar el tiempo de respuesta y saber qu\xe9 productos tienen mejor oportunidad y cu\xe1l es su precio para tener una respuesta m\xe1s r\xe1pida y seguimientos precisos.",fr_FR:"L'application Pricing est n\xe9e de la n\xe9cessit\xe9 de r\xe9duire le d\xe9lai existant dans la collecte d'informations aupr\xe8s des concurrents.\n\nComme objectif principal d'apporter l'agilit\xe9 et la facilit\xe9 du monde num\xe9rique, l'obtention de donn\xe9es en temps r\xe9el.Ainsi, pouvoir comparer les mix des concurrents et optimiser le temps de r\xe9ponse et savoir quels produits ont la meilleure opportunit\xe9 et quel est leur prix afin d'avoir une r\xe9ponse plus rapide et des suivis pr\xe9cis."},B.t,t.w)
