B.XB=new A.y(4,{en_us:"Always aiming to benefit society, the application aims to maximize the decision time of which place of care is the best for the user, based on the health plan, type of care, and location, in order to optimize time. decision-making process, as well as minimizing the possibility of wrongly choosing which hospital or emergency room to go to.",pt_br:"Visando sempre o benef\xedcio para a sociedade o aplicativo tem como meta potencializar o tempo de decis\xe3o de qual local de atendimento \xe9 o melhor para o usu\xe1rio, tendo como base o plano de sa\xfade, tipo do atendimento, e localiza\xe7\xe3o, a fim de otimizar o tempo de decis\xe3o, bem como minimizar a possibilidade de escolha errada a qual hospital ou pronto socorro se dirigir.",es_ES:"Siempre con el objetivo de beneficiar a la sociedad, la aplicaci\xf3n tiene como objetivo maximizar el tiempo de decisi\xf3n de qu\xe9 lugar de atenci\xf3n es el mejor para el usuario, en funci\xf3n del plan de salud, el tipo de atenci\xf3n y la ubicaci\xf3n, con el fin de optimizar el tiempo del proceso de toma de decisiones. as\xed como minimizar la posibilidad de elegir err\xf3neamente a qu\xe9 hospital o urgencias acudir.",fr_FR:"Toujours dans le but de b\xe9n\xe9ficier \xe0 la soci\xe9t\xe9, l'application vise \xe0 maximiser le temps de d\xe9cision quant au lieu de soins qui convient le mieux \xe0 l'usager, en fonction du plan de sant\xe9, du type de soins et de l'emplacement, afin d'optimiser le processus de prise de d\xe9cision, ainsi que de minimiser la possibilit\xe9 de choisir \xe0 tort l'h\xf4pital ou la salle d'urgence o\xf9 aller."},B.t,t.w)
B.XE=new A.y(4,{en_us:"Tmath is an application that explores trigonometric equations, through concepts and exercises, with step-by-step demonstration steps, helping students to understand the process of solving trigonometric equations, being useful for both high school and elementary school students, as well as for college students. \n\nThe exercises are divided into chapters, to release the next chapters, you have to answer the minimum required questions.",pt_br:"Tmath \xe9 uma aplica\xe7\xe3o que explora as equa\xe7\xf5es trigonom\xe9tricas, atrav\xe9s de conceitos e exerc\xedcios, com etapas de demonstra\xe7\xe3o passo a passo, ajudando aos estudantes a compreender o processo de resolu\xe7\xe3o de equa\xe7\xf5es trigonom\xe9tricas, sendo \xfatil tanto para os estudantes de ensino m\xe9dio, fundamental, como para estudantes universit\xe1rios. \n\nOs exerc\xedcios s\xe3o divididos em cap\xedtulos, para liberar os pr\xf3ximos cap\xedtulos, voc\xea tem que acertar as perguntas m\xednimas exigidas.",es_ES:"Tmath es una aplicaci\xf3n que explora ecuaciones trigonom\xe9tricas, a trav\xe9s de conceptos y ejercicios, con pasos demostrativos paso a paso, ayudando a los estudiantes a comprender el proceso de resoluci\xf3n de ecuaciones trigonom\xe9tricas, siendo \xfatil tanto para estudiantes de secundaria y primaria, como para universitarios. estudiantes. \n\nLos ejercicios est\xe1n divididos en cap\xedtulos, para liberar los pr\xf3ximos cap\xedtulos, tienes que responder las preguntas m\xednimas requeridas.",fr_FR:"Tmath est une application qui explore les \xe9quations trigonom\xe9triques, \xe0 travers des concepts et des exercices, avec des \xe9tapes de d\xe9monstration \xe9tape par \xe9tape, aidant les \xe9tudiants \xe0 comprendre le processus de r\xe9solution des \xe9quations trigonom\xe9triques, \xe9tant utile pour les \xe9l\xe8ves du secondaire et du primaire, ainsi que pour le coll\xe8ge \xe9l\xe8ves. \n\nLes exercices sont divis\xe9s en chapitres, pour lib\xe9rer les chapitres suivants, vous devez r\xe9pondre aux questions minimales requises."},B.t,t.w)
B.XW=new A.y(4,{en_us:"I have had the pleasure of working with Anwar on two flutter projects and what strikes me the most about his work is his ability to write clean and reusable codes with best practices. He is hardworking and makes it so easy to transcribe ideas into beautiful and testable flutter apps. He is a Flutter/Dart gem and has my highest recommendation",pt_br:"Tive o prazer de trabalhar com Anwar em dois projetos flutter e o que mais me impressiona em seu trabalho \xe9 sua capacidade de escrever c\xf3digos limpos e reutiliz\xe1veis com as melhores pr\xe1ticas. Ele \xe9 trabalhador e torna muito f\xe1cil transcrever ideias em aplicativos de vibra\xe7\xe3o bonitos e test\xe1veis. Ele \xe9 uma joia do Flutter/Dart e tem minha recomenda\xe7\xe3o mais alta",es_ES:"He tenido el placer de trabajar con Anwar en dos proyectos de flutter y lo que m\xe1s me sorprende de su trabajo es su capacidad para escribir c\xf3digos limpios y reutilizables con las mejores pr\xe1cticas. Es muy trabajador y hace que sea muy f\xe1cil transcribir ideas en aplicaciones de aleteo hermosas y comprobables. Es una joya de Flutter/Dart y tiene mi m\xe1s alta recomendaci\xf3n.",fr_FR:"J'ai eu le plaisir de travailler avec Anwar sur deux projets flutter et ce qui me frappe le plus dans son travail est sa capacit\xe9 \xe0 \xe9crire des codes propres et r\xe9utilisables avec les meilleures pratiques. Il travaille dur et rend si facile la transcription d'id\xe9es dans de belles applications de flutter testables. Il est un joyau Flutter / Dart et a ma plus haute recommandation"},B.t,t.w)
